var $bm_rt;
var baseScale, maxFlutter, minFlutter, baseSpeed, speedVariation, irregularity, flapProbability, currentSpeed, flutterRange, t, shouldFlap, flutterFactor, burstPattern, flutterIntensity, smoothIntensity;
baseScale = transform.scale.value;
maxFlutter = 25;
minFlutter = 15;
baseSpeed = 8;
speedVariation = 3;
irregularity = 0.7;
flapProbability = 0.8;
seedRandom(index, true);
currentSpeed = $bm_sum(baseSpeed, random($bm_neg(speedVariation), speedVariation));
flutterRange = $bm_sum(minFlutter, $bm_mul($bm_sub(maxFlutter, minFlutter), random()));
t = $bm_mul($bm_mul(time, currentSpeed), $bm_sum(0.7, $bm_mul(0.6, noise($bm_mul(time, 0.3)))));
shouldFlap = random() > $bm_sub(1, flapProbability) ? 1 : 0;
flutterFactor = $bm_mul($bm_mul(shouldFlap, Math.abs(Math.sin($bm_mul(t, 2)))), $bm_sum(1, $bm_mul(irregularity, noise(t))));
burstPattern = $bm_mul(shouldFlap, Math.pow(Math.sin($bm_mul(t, 0.3)), 3));
flutterIntensity = $bm_mul(flutterRange, Math.max(flutterFactor, $bm_mul(burstPattern, 0.7)));
smoothIntensity = easeOut(flutterIntensity, 0, flutterRange, 0, flutterRange);
$bm_rt = [
    baseScale[0] - smoothIntensity,
    baseScale[1] + smoothIntensity * (1.2 + 0.3 * noise(time * 2))
];
function easeOut(t, min, max, newMin, newMax) {
    t = $bm_div($bm_sub(t, min), $bm_sub(max, min));
    t = Math.min(Math.max(t, 0), 1);
    return $bm_sum(newMin, $bm_mul($bm_sub(newMax, newMin), $bm_sum($bm_mul($bm_mul(--t, t), t), 1)));
}

